import React from 'react';
import Header from '../Header/Index';
import {Row,Col} from 'antd';
import C from './CLD';
const Index=(props)=>{
    return (
        <div>
            <Row>
                <Col flex={1}><Header e={7}/></Col>
                <Col flex={4}>
                    <Calendar />
                </Col>
            </Row> 
        </div>
    );
}

export default Index;
